import { observer } from "mobx-react-lite"
import '../stores/grid'
import SquareView from "./squareView"
import ButtonGroup from 'react-bootstrap/ButtonGroup'

import '../index.css'

const GridView = observer(({ grid }) => (
    /*<div className="app-grid">
        {grid.squares.map(row => row.map(col => (
            <Square square={col} key={col.id} />
        )))}
    </div>*/

    <div className="app-grid">
        <ButtonGroup vertical>
            {grid.squares.map(row => (
                <ButtonGroup>
                    {row.map(col => (
                        <SquareView col={col} row={row} key={col.id} />
                    ))}
                </ButtonGroup>
            ))}
        </ButtonGroup> 
    </div>

    /*<table>
        <tbody>
            {grid.squares.map(row => {
                return (
                    <tr>
                        {row.squares.map(col => {
                            const {type, id} = col;
                            return (
                                <Square square={type} key={id}></Square>
                            )
                        })}
                    </tr>
                )
            })}
        </tbody>
    </table>*/
))

export default GridView
